INSERT INTO `EVENTOS` (`identificador`, `nombre`, `imagen`, `informacion`) VALUES
	(1, 'Evento de pintura al óleo', 'Quitasol.png', 'Disfruta de una exposición de pintruas al óleo, dónde poder entender cómo se realizan estas pinturas a través de talleres, de la mano de grandes profesionales del sector.\n------Horario------\nLunes: 12:00 - 13:30'),
	(2, 'Evento Velázquez', 'LasMeninas.png', 'Observa todas las obras del famoso pintor Diego Velázquez, pintor barroco considerado uno de los máximos exponentes de la pintura española y maestro de la pintura universal.\n------Horario------\nMartes: Todo el día\nJueves: Todo el día'),
	(3, 'Evento Capilla Sixtina', 'Sixtina.jpg', '¿Sientes curiosidad por visitar la Capilla Sixtina?\nPues no esperes más, aquí te mostramos varias de esos frescos para analizar y aprender de su historia.\n------Horario------\nViernes: 18:00 - 21:00\nSábado: 11:00 - 15:00'),
	(4, 'Da Vinci: sus pinturas', 'Davinci.jpg', 'En la historia hemos vivido todas las pinturas de Davinci\n------Horario------\nMiércoles: Todo el día\nDomingo: 12:00 - 18:00');
